pragma solidity ^0.6.12;

contract MyContract {
    address public owner;
    uint256 public ordercount;
    uint256 public fee;
    uint256 public lockedfees;
    uint256 public totalfees;
    mapping (address => uint256) public feebalances;
    address[] public addressregistry;
    mapping (address => uint256) public addressindex;
    mapping (uint256 => bytes) private tokenURI;
    uint256[] public orderbookkey;
    address public poolowners;
    address public feetoken;

    constructor() public {
      owner = msg.sender;
    }

    function setFee(uint256 _fee) public {
        require(msg.sender == owner);
        require(_fee <= 0x6f05b59d3b20000);
        fee = _fee;
    }

    function withdrawDistributedToPoolOwners() public {
        bytes memory data = abi.encodeWithSignature("balanceOf(address)", address(this));
        (bool success, bytes memory returnData) = feetoken.call(data);
        require(success);
        require(returnData.length >= 32);
        uint256 v0 = abi.decode(returnData, (uint256));
        require(totalfees <= v0);
        require(v0 - totalfees > 0);
        bytes memory data2 = abi.encodeWithSignature("transfer(address,uint256)", poolowners, v0 - totalfees);
        (success,) = feetoken.call(data2);
        require(success);
    }

    // More functions to be added here according to the requirements...

}
